package com.baidu.domain;public class Menu {    private Integer id;    private String url;    private String name;    private Integer parentId;    @Override    public String toString() {        return "Menu{" +                "id=" + id +                ", url='" + url + '\'' +                ", name='" + name + '\'' +                ", parentId=" + parentId +                '}';    }    public Integer getId() {        return id;    }    public void setId(Integer id) {        this.id = id;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Integer getParentId() {        return parentId;    }    public void setParentId(Integer parentId) {        this.parentId = parentId;    }    public Menu() {    }    public Menu(String url, String name, Integer parentId) {        this.url = url;        this.name = name;        this.parentId = parentId;    }    public Menu(Integer id, String url, String name, Integer parentId) {        this.id = id;        this.url = url;        this.name = name;        this.parentId = parentId;    }}